import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';
import News from './components/News';

import React, { Component } from 'react'
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";


export default class App extends Component {
  render() {
    return (
      <Router>
      <>
      <Navbar/>
      <News pageSize={5} country={"in"} category={"general"}/>

      <Routes>
        <Route path='/science' key="science" element={<News pageSize={5} country={"in"} category={"science"}/>}></Route>
      </Routes>

      <Routes>
        <Route path='/business' key="business" element={<News pageSize={5} country={"in"} category={"business"}/>}></Route>
      </Routes>

      <Routes>
        <Route path='/entertainment' key="entertainment" element={<News pageSize={5} country={"in"} category={"entertainment"}/>}></Route>
      </Routes>

      <Routes>
        <Route path='/health' key="health" element={<News pageSize={5} country={"in"} category={"health"}/>}></Route>
      </Routes>

      <Routes>
        <Route path='/science' key="science" element={<News pageSize={5} country={"in"} category={"science"}/>}></Route>
      </Routes>

      </>
      </Router>

    )
  }
}
